"title": "Set of 4 Engraved Large US Army Whiskey Rocks with Muslin Bag, Perfect Stocking Stuffer, Great US Military Christmas Gift, Made in the USA",
"description": "Whiskey Stones are a Unique and Popular gift on their own, but when they are personalized they become extra special.\n\nThis listing is for a set of 4 Large Engraved Whiskey Stones.  They make a great gift for a current or veteran Military hero!  \n\nChristmas, Birthdays, Anniversaries, Military Weddings, Whiskey Stones are always a well received gift.\n\nEach Whiskey Stone measures 1.15&quot; x 1&quot; and is made of 100% Soapstone right here in the USA. Only 1 or 2  are needed per drink.  Each set comes in it&#39;s own Muslin Storage bag with an instructions for use card.\n\nThe pictured stones are currently engraved with the US Army Emblem, US Army and the recipients Initials however each order can be customized and I can engrave anything on the Stones, just send me your engraving instructions in the &quot;Notes to Seller&quot; section at check out or send me an Etsy Convo.  If you would like to use a different Military Logo please let me know.\n\n**Please note the listing is for only ONE SIDE of each stone engraved, they can be the same as the main picture or please feel free to switch out any of the images or words and replace them with initials or names etc... Please specify any changes in the Notes to Seller at checkout**\n\n**What are Whiskey Stones?**\n\nWhiskey Stones, are a new way to chill your whiskey or wine without diluting your drink. Ice cubes water down your whiskey and leave a moist layer of condensation on your glass, whiskey stones have all the benefits of ice without the hassles.\n\nWhiskey Stones are made out of cubes of solid soapstone which is softer than granite and won’t scratch your glass. Soapstone retains its temperature much longer than ice, so it will cool your whiskey or liquor of your choice and provide a more sustained chill. Whiskey Stones are also non-porous, odorless and tasteless so they won’t alter your favorite drinks. Whiskey Stones can also be used to warm your drinks and work well with non-alcoholic beverages too.  Whiskey stones are Dishwasher Safe.\n\n**I&#39;M ALL ABOUT CUSTOM ORDERS SO IF YOU NEED MULTIPLES PLEASE CONTACT ME FOR A DISCOUNT PRICE, I WILL DO MY BEST TO WORK WITHIN YOUR BUDGET**\n\nStill thinking and in need of more ideas?  Check out my shop via the link below for more great gifts for Men.  I add new items weekly so please Favorite my shop so you are the first to see the new arrivals.\nhttps://www.etsy.com/shop/TheUltimateManShop",
