"policy_welcome": "Welcome to our shop!  We hope you can find your time here browsing or the enjoyment of a purchase you make with us, one of those moments in you life that are joyous. Every item we have, was hand made, reclaimed or upcycled during one of our Life&#39;s Joyous Moments!",
"policy_payment": "We accept Paypal only.  If you need any assistance here is a link to Etsy&#39;s checkout help guide. \r\nhttp://www.etsy.com/help/article/339\r\n\r\nPayment must be made in 3 days of sale or your order will be canceled. If you need more time to make your payment, let us know and we will be happy to work something out.",
"policy_shipping": "Packages will be shipped through USPS Priority, Parcel Post or First Class and UPS\r\nWe ship in 1 - 3 business days after receiving payment.\r\nCustom Orders require 1-2 weeks to process after receiving payment.\r\n\r\nTRACKING#’S  \r\n    We provide delivery confirmation/tracking numbers  for all domestic (US) packages and provide the \r\nconfirmation number to you as soon as we have shipped your order, so that you may track the delivery \r\nof your purchase. \r\nAll out of country tracking numbers typically only track the package&#39;s travel from our local post office to its&#39; leaving of the US. \r\n\r\nOnce items are in possession of the USPS or UPS, we can not be responsible for lost, stolen or damaged \r\nitems. \r\n\r\nINSURANCE is available on request for an additional charge. We thank you for your understanding. \r\n\r\nSHIPPING TO OTHER COUNTRIES:\r\n   We are more than happy to ship our products to countires outside of the U.S.  Please be aware that the shipping we purchase at our post office is for oneway shipping.  If you should choose to send it back, refuse delivery or never pick it up, the package will be marked &quot; if undeliverable please treat as abandoned.&quot; That means, it will not come back to us for returns and refunds unless the buyer personally takes it to their post office and pays postage upfront for the return. If the package gets treated as abandoned, we would not be able to do any refunds or exchanges so PLEASE make sure your delivery address is correct with Paypal and Etsy. \r\n\r\nPlease do not ask us to alter the customs monetary value as we will not.\r\n",
"policy_refunds": "We have a No Refund policy.  Although, we want you to be completely happy with your purchase.  If there are any problems with your purchase, please contact us and we will do our best to remedy the situation!\r\n",
"policy_additional": "PURCHASING OUR PRODUCTS AS GIFTS We are more than happy to send out our products to someone special as a gift. Please make a note in &#39;note to seller&#39; when purchasing that item. Leave the recipients name and shipping address there and If you would like a special message sent along! All our items are neatly wrapped. SAFETY Products could pose a CHOKING HAZARD. Please provide adult supervision when your child is wearing our products. CUSTOM ORDERS Custom requests are accepted. Please keep in mind, many of our products cannot be reproduced exactly,since we use upcycled, vintage and handmade products for our creations as much as possible. We do not start any custom orders before payment of order. Once order is paid for, allow 1-2 weeks for processing",
